import math


def gcd(a, b):
    while b:
        a, b = b, a % b
    return a


def lcm(a, b):
    return a * b // gcd(a, b)


x = int(input())

for a in range(1, x + 1):
    for b in range(a + 1, x + 1):
        if lcm(a, b) == x:
            print(a, b)
            break

